    private DataSetInterface dataset;

    @Before
    public void init() {
        FreeInductionDecayDatasetSimulator simulator = new FreeInductionDecayDatasetSimulator();
        simulator.getAcquisitionParameters().get(NmrDefaultParams.SPECTRAL_WIDTH.name()).setValue(1e3);
        simulator.getAcquisitionParameters().get(NmrDefaultParams.ACQUISITION_MATRIX_DIMENSION_1D.name()).setValue(1024);
        simulator.getAcquisitionParameters().get(NmrDefaultParams.ACQUISITION_MATRIX_DIMENSION_2D.name()).setValue(1);
        simulator.getAcquisitionParameters().get(NmrDefaultParams.BASE_FREQ_1.name()).setValue(128e6);
        simulator.getAcquisitionParameters().get(NmrDefaultParams.OFFSET_FREQ_1.name()).setValue(-100);
        dataset = simulator.simulate();
    }

    private void execute(Double width, Integer offset) {
        Gauss process = new Gauss(dataset);
        Param[] params = process.getParam();

        if (width != null) {
            params[0].setValue(width);
        }

        if (offset != null) {
            params[1].setValue(offset);
        }

        process.execute(params);
    }

    @Test
    public void testExecuteGaussWithDefaultParameters() {
        execute(null, null);
        Assert.assertArrayEquals("Test real part of Gauss apodization with default parameters",
                EXPECTED_W_0P1_O_0_REAL, dataset.getData(0).getRealPart()[0][0][0], 1e-3f);
        Assert.assertArrayEquals("Test imaginary part of Gauss apodization with default parameters",
                EXPECTED_W_0P1_O_0_IMAG, dataset.getData(0).getImaginaryPart()[0][0][0], 1e-3f);
    }

    @Test
    public void testExecuteGaussWithWidth() {
        execute(0.5, null);
        Assert.assertArrayEquals("Test real part of Gauss apodization with width=0.5",
                EXPECTED_W_0P5_O_0_REAL, dataset.getData(0).getRealPart()[0][0][0], 1e-2f);
        Assert.assertArrayEquals("Test imaginary part of Gauss apodization with width=0.5",
                EXPECTED_W_0P5_O_0_IMAG, dataset.getData(0).getImaginaryPart()[0][0][0], 1e-2f);
    }

    @Test
    public void testExecuteGaussWithOffset() {
        execute(null, 10);
        Assert.assertArrayEquals("Test real part of Gauss apodization with offset=10",
                EXPECTED_W_0P1_O_10_REAL, dataset.getData(0).getRealPart()[0][0][0], 1e-4f);
        Assert.assertArrayEquals("Test imaginary part of Gauss apodization with offset=10",
                EXPECTED_W_0P1_O_10_IMAG, dataset.getData(0).getImaginaryPart()[0][0][0], 1e-4f);
    }

    @Test
    public void testExecuteGaussWithWidthAndOffset() {
        execute(0.25, 600);
        Assert.assertArrayEquals("Test real part of Gauss apodization with width=0.25 and offset=600",
                EXPECTED_W_0P25_O_600_REAL, dataset.getData(0).getRealPart()[0][0][0], 1e-4f);
        Assert.assertArrayEquals("Test imaginary part of Gauss apodization with width=0.25 and offset=600",
                EXPECTED_W_0P25_O_600_IMAG, dataset.getData(0).getImaginaryPart()[0][0][0], 1e-4f);
    }
